import Loader from '../Loader/Loader';
import axios from 'axios';

import {useState, useEffect} from 'react';

function CookieDetailsForm(props){
    return(
        <div className= " alert alert-light alert-dismissible fade show d-flex flex-column align-items-center position-fixed col-12 h-100" role="alert">
            <h4>Add New Cookie</h4>
            <div h-25><hr/></div>
            <form className= "col-6" form-light>
                <div className="mb-3">
                    <label for="inputCookieName" className="form-label">Cookie Name</label>
                    <input type="text" className="form-control" id="inputCookieName" aria-describedby="emailHelp"/>
                </div>
                <div className="mb-3">
                    <label for="inputDescription" className="form-label">Description</label>
                    <input type="text" className="form-control" id="inputDescription"/>
                </div>
                <div className="mb-3 form-check">
                    <input type="checkbox" className="form-check-input" id="exampleCheck1"/>
                    <label className="form-check-label" for="exampleCheck1">Check me out</label>
                </div>
                <button type="submit" className="btn btn-dark">Submit</button>
            </form>
            <button type="button" class="btn-close" data-bs-dismiss="alert" aria-label="Close"></button>
        </div>
    );
}

export default CookieDetailsForm;
